@notice Get the address of the proxy to be deployed.
 @dev The address is determined solely by creation code of `imAccountProxy` and the salt, constructor arguments not included.
 @param salt The salt of CREATE2, used to create the account.
 @return The address of the proxy to be deployed.

@notice Create a new account with the given salt and the initialization code.
 @dev Only factory owner can create accounts.
 @param initializer The code used to call the created account to initialize it.
 @param salt The salt of CREATE2, used to create the account.
 @return proxy The address of the created account.

@notice Create a new account with params in `CreateAccount` request. Authorized by owner's signature.
 @dev This is intended to be used by ERC-4337 EntryPoint contract.
 @param createAccountRequest The `CreateAccount` request.
 @param signature The signature from factory owner, to authorize the `CreateAccount` request.
 @return proxy The address of the created account.

