 If the proxy is already deployed, return the proxy's address directly.
 Revert if initialization fails.
 @param initializer The code used to call the created account to initialize it.
 @param salt The salt of CREATE2, used to create the account.
 @return proxy The address of the created account.

@title Factory contract to create `imAccount`. Only factory owner can create accounts.
 @notice `imAccount` is created in two steps: 1. deploy `imAccountProxy` and set its implementation as `imAccount`, 2. initialize the account.
 @dev To deploy the proxy and the proxy factory to the same address on different chains, make sure you compile them with same evm_version and solc_version.
